// components/Timeline.js
import React from 'react';
import {styled, keyframes} from 'styled-components';
import TimelineItem from './components/TimelineItem';

const bottomUpSweep = keyframes`
  from {
    transform: translateY(100%);
  }
  to {
    transform: translateY(0);
  }
`;


const TimelLineBackGround = styled.div`
background-color: rgbr(135, 31, 173, 0.8));
`;

const Timeline = ({ photos }) => {
  return (
    <TimelLineBackGround>
    <TimelineContainer>
      {photos.map((photo, index) => (
        <TimelineItem key={index} photo={photo} />
      ))}
    </TimelineContainer>
    </TimelLineBackGround>
  );
};

const TimelineContainer = styled.div`
  display: flex;
  overflow-x: auto;
  padding-bottom: 20px; /* To make room for the scrollbar */
  animation: ${bottomUpSweep} 2s ease;
`;

export default Timeline;
